('0a5b8f13-457c-4d2d-9d65-601f59921a4f', 'Cho thuê nhà mặt tiền nguyên căn Nhà Bè', '0', 'TZQY6', 'Địa chỉ: 58/27 Nguyễn Văn Tạo, Xã Long Thới, Huyện Nhà Bè, Hồ Chí Minh', '89304955-b8a5-4ddd-bb4b-c9a5c223c43c', 'CTN', '[\"Cho thuê nhà mặt tiền nguyên căn Nhà Bè\",\"- Địa chỉ: 58/27 Nguyễn Văn Tạo, Xã Long Thới, Huyện Nhà Bè, Hồ Chí Minh\",\"- Tổng diện tích 60m2, 1 trệt, 1 lầu, 2 WC, 1 phòng ngủ.\",\"- Đường nhựa 6m, xe hơi vô tới chỗ.\",\"- Nằm trong khu dân cư cán bộ, công nhân viên.\",\"- Cách Phú Mỹ Hưng 10 phút, cách chợ 5 phút, cách khu công nghiệp Hiệp Phước 5 phút, Khu công nghiệp Long Hậu 10 phút.\",\"- Cách Huỳnh Tấn Phát ( thông qua đường Nguyễn Bình ) 10 phút.\",\"- Gần trường học ( mẫu giáo, tiểu học, trung học, American school ), trạm y tế, siêu thị Coop mart,..\",\"- Không kẹt xe, không ngập nước. An ninh, yên tĩnh, thoáng mát.\",\"- Điện , nước giá nhà nước.\",\"Nhà có hàng rào sắt phía trước ( 1,5 x 3,5m ), dựng xe thoải mái.\",\"Mình không có đăng tin dịch vụ quảng cáo nên các bạn môi giới đăng tin đừng liên hệ dùm nhé. Cảm ơn\"]', 'a75adcde-811b-4cca-a82f-90bb90cbdde6', 'e34ee53f-b59f-4644-a9fd-4a00426a98bd', NULL, '2023-10-04 03:37:37', '2023-10-04 03:37:37'),
('0ab9e365-c643-4eac-a390-975718ae35da', 'Phòng trọ tiện nghi, mới xây sạch sẽ tại 60/25/13 Lê Văn Duyệt, P1, Quận Bình Thạnh. Liên hệ: 0917833599', '3', 'BAYN3', 'Địa chỉ: 60/25/13 Đường Lê Văn Duyệt, Phường 1, Quận Bình Thạnh, Hồ Chí Minh', '0532b709-67fc-4052-98b8-eca798dd7626', 'CTPT', '[\"Phòng trọ tiện nghi ngay trung tâm quận Bình Thạnh (gần chợ, siêu thị, 24h, clb, sân vận động, hồ bơi, nhà thờ, chùa, bệnh viện, trạm xá, trường học, khu ăn uống, công viên, ...)\",\"Phòng mới, diện tích 13m2-18m2, sạch đẹp, thoáng, sáng, phòng có cửa sổ, toilet riêng thơm thoáng, ban công mát mẻ, có máy giặt, máy sấy quần áo, wi-fi..\",\"Giờ giấc tự do, có người giữ xe, hành lang có camera, hẻm an ninh có sân chơi, có camera chống trộm, chống tệ nạn quanh khu.\",\"Giá phòng từ 2tr5 đến 3tr, điện 4.000/kw, nước máy 20.000/m3. Wifi 50.000/phòng, xe 150k/xe.tháng.\",\"Và Hiện tại còn có 1 phòng có nhu cầu ở ghép nam. Khách có nhu cầu tiết kiệm chi phí thì hãy liên hệ nhé.\",\"60/25/13 Lê Văn Duyệt, P1 ,Bình Thạnh (qua cầu Bông là ngay quận 1). Liên hệ: 0917833599 anh Đức Việt\"]', '6f32e311-e29e-408b-bfe3-01574a85a4ce', 'efe1883e-62b5-41ab-8dcb-2acb921ae45f', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
