('3c9759d9-f665-458e-af72-456f03f303c3', 'Cho thuê nhà 316 Đê La Thành lối đi cửa riêng', '0', 'TIEW9', 'Địa chỉ: 316 Đường Đê La Thành, Phường Thổ Quan, Quận Đống Đa, Hà Nội', 'ec6633c1-98f6-4830-b557-0b49f4dfae18', 'CTN', '[\"Cho thuê nhà 316 Đê La Thành (Xã Đàn) từ tầng 2 trở lên, có lối đi và cửa riêng, có chỗ để xe, có đầy đủ nội thất như có chiếc điều hòa 2 chiều LG, quạt, bình nóng lạnh, tủ, giường ngủ...\",\"Vị trí thuận tiện việc đi lại làm ăn, cách Ô Chợ Dừa 50 m, xung quanh ngân hàng, siêu thị, chợ, an ninh cao, khu vực thuận tiện cho bán hàng online, các cửa hàng vận chuyển như J&t, giao hàng nhanh, GHTK, Shopee Express, Viettel Post chỉ cách 50m, cách tuyến xe đi Nội Bài , ,\",\"Tàu điện đi Cát Linh Hà Đông 200m...\",\"Khách hàng chỉ việc xách va ly đến ở, ưu tiên cho hộ gia đình hoặc các bạn nữ còn đang đi làm hay đi học ở Hà Nội.\"]', '4b157b7f-97af-45c9-b401-8bf59d15974f', '56d9ff55-3e63-4b8c-8826-f54884849f7f', NULL, '2023-10-04 03:37:37', '2023-10-04 03:37:37'),
