('7c3da845-025a-42a7-9e9f-fe488086007d', 'Cho thuê căn hội full nội thất gần cầu Khánh Hội hồ bơi Vân Đồn sát Quận 1', '0', 'BPUM7', 'Địa chỉ: Tôn Thất Thuyết, Phường 15, Quận 4, Hồ Chí Minh', 'c991cd8b-e0f5-4ea6-8bea-c2270ddeed89', 'CTCH', '[\"Hệ thống căn hộ cho thuê khắp quận 4.\",\"Gần trung tâm thương mại/chợ Xóm Chiếu, công viên Khánh Hội, cầu Kênh Tẻ, hồ bơi Vân Đồn, Trung tâm thể dục thể thao Quận 4.. Tiện đi Q1 Q5 Q10.\",\"- Khu vực an ninh, giờ giấc tự do, bảo vệ 24/24.\",\"- Hầm xe rộng rãi, toà nhà có thang máy.\",\"- Gần chợ, siêu thị tiện ích.\",\"- Dễ dàng di chuyển sáng q1, q4, q8.\",\"Các dạng phòng:\",\"Studio 5tr5 - 7tr/th.\",\"Duplex 6tr5 - 8tr/th.\",\"1PN 7tr8 - 12tr/th.\",\"2PN 13tr - 14tr/th.\",\"---------------------------------------\",\"Căn hộ dịch vụ, chung cư, phòng trọ cho thuê.\",\"Hotline: 039.900.8879 Thảo( call/zalo)\"]', '9b5b0eff-5d50-46a8-8254-0b141edb514e', 'f945e190-cf81-446c-8bbc-3e35b570945f', NULL, '2023-10-04 03:36:54', '2023-10-04 03:36:54'),
('7f174037-a594-4051-93f9-12f0ce1c7554', 'Nhà Nguyên Căn 4x11m Cao Lỗ Đồng Diều Q8 Chỉ 4,7 Triệu Gọi 0939609011', '0', 'PYJP4', 'Địa chỉ: Cao Lỗ, Phường 4, Quận 8, Hồ Chí Minh', '9474961a-7aaa-4d14-a9e7-c69fbf1d0a7c', 'CTN', '[\"Cho thuê nhà riêng nguyên căn 44m2 Quận 8 chỉ 4,7 triệu/tháng\",\"Địa chỉ đường Cao Lỗ khu Đồng Diều Quận 8\",\"Thiết kế Ngang 4m dài 11m., có 1 trệt 1 gác.\",\"Nhà mới sơn mới quét dọn sạch sẽ.\",\"Nhà riêng nguyên căn nên giờ giấc tự do, điện nước nhà nước.\",\"Vị trí thuận tiện gần chợ, trường học di chuyển nhanh qua Q1, Q5, Q10, Q7, Bình Chánh\",\"Cọc 1 tháng, giá 4.7 tr/tháng.\",\"Gọi chính chủ xem nhà\"]', 'c5a763f7-81db-4a7f-95e4-d4f50c73e080', '39fc9506-b423-4a8f-9c88-bddc91a033f4', NULL, '2023-10-04 03:37:37', '2023-10-04 03:37:37'),
('7ff9b488-65c3-4b3c-b452-95562af7298f', 'Cho thuê phòng mới diện tích 35m2, giá 5tr/tháng có sẵn đầy đủ nội thất', '5', 'GWVF8', 'Địa chỉ: Đường số 61, Phường Thạnh Mỹ Lợi, Quận 2, Hồ Chí Minh', 'ad9d6ecd-1a95-44f9-b86b-9209dde7a6bc', 'CTPT', '[\"Mình cần cho thuê phòng mới diện tích 32m2, giá 5tr/tháng có sẵn nội thất cơ bản\",\"Địa chỉ: 17 Đường số 61, Phường Thạnh Mỹ Lợi, Quận 2, Hồ Chí Minh\",\"- Giá cho thuê: 5tr/tháng\",\"- Có sẵn nội thất cơ bản: Giường, Tủ, Máy lạnh\",\"- Có chỗ nấu ăn\",\"- Có hầm để xe miễn phí\",\"- Có thang máy.\",\"- Điện: 4k/kg, nước 20k/khối\",\"- Internet free siêu mạnh.\"]', '1876a690-a580-4c17-8fb5-7da4474d95b9', '24457a4d-26b2-456f-8229-34729bea7a93', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
('82b3f041-edb6-4b7d-8fa7-6a7c04d5b644', 'Căn hộ mini đẹp giá rẻ Hương Lộ 2 Bình Tân', '0', 'PBTW3', 'Địa chỉ: Đường Hương lộ 2, Phường Bình Trị Đông A, Quận Bình Tân, Hồ Chí Minh', '3b7d3cc6-fb8d-4c63-9e60-7dbfb60809a7', 'CTCH', '[\"Vị trí: hương lộ 2, Bình trị Đông gần Ngã tư Bốn xã, bệnh viện Bình Tân, Tân Hoà Đông\",\"Nội thất: Máy lạnh, gác, tủ quần áo, kệ bếp.\",\"Phòng sạch sẽ, thoáng mát. Giờ giấc tự do, khoá cổng vân tay.\",\"Camera an ninh, sân phơi tầng thượng.\",\"Bãi giữ xe chung, vệ sinh hành lang thường xuyên, wifi từng lầu.\",\"Khu vực an ninh, yên tĩnh. Cho nuôi thú cưng.\",\"Chi phí: Điện: 3,5k/Kwh. Nước: 100k/người. Xe: 100k/xe. Phí dịch vụ: 100k/phòng.\",\"Giá thuê: 3.200.000 - 3.700.000\",\"Nếu quý khách hàng quan tâm, vui lòng liên hệ số điện thoại 0916240962 gặp Nhật để được tư vấn và xem phòng trực tiếp. Cảm ơn!\"]', '0ccb1d2b-de0e-4f68-9daf-7ff4d4f5c840', 'a575fe1d-39d7-471e-8ac9-47bac96e753c', NULL, '2023-10-04 03:36:54', '2023-10-04 03:36:54'),
('88563cf0-411b-4406-805a-276110958823', 'Cho thuê tầng 1 nhà mặt phố kinh doanh tốt tại 26 Trung Liệt Đống Đa Hà Nội 48m2 mặt tiền 4.5m', '0', 'FLCO9', 'Địa chỉ: 26 Phố Trung Liệt, Phường Trung Liệt, Quận Đống Đa, Hà Nội', '391dd5e4-fd1f-436b-a495-0d86f66d7a7e', 'CTMB', '[\"Cho thuê tầng 1 nhà mặt phố Trung Liệt-Đống Đa\",\"- Diện tích: 48m2.\",\"- Mặt tiền: 4,5m.\",\"- Phù hợp sử dụng cho nhiều loại hình kinh doanh: Văn phòng, nhà thuốc, spa (không kinh doanh hàng ăn).\",\"- Đặc điểm nổi bật:\",\"+ Khu vực sầm uất, chỉ cách phố Thái Hà vài bước chân.\",\"+ Gần chợ Thái Hà, trường học, bệnh viện và khu văn phòng.\",\"+ Không gian thoáng đãng, được tận dụng ánh sáng tự nhiên.\",\"+ Vệ sinh riêng biệt đảm bảo sự riêng tư.\",\"- Hợp đồng dài hạn mang lại sự ổn định và thuận lợi cho bạn.\",\"- Liên hệ chính chủ để biết thêm thông tin và đặt lịch xem nhà: 0989 550 763.\"]', 'd7bc6d4e-c4cc-4a79-94fa-b52dfbaf86f8', '989aa077-e822-4cb3-9afe-b3db64a767a6', NULL, '2023-10-04 03:37:26', '2023-10-04 03:37:26');
