('8eb9cefc-1cdf-42dc-990a-782ae1480549', 'Phòng VIP gần cổng Văn Lang, full nội thất, có ban công', '4', 'JKYQ7', 'Địa chỉ: 73 Đặng Thuỳ Trâm, Phường 13, Quận Bình Thạnh, Hồ Chí Minh', '9f956513-3a84-41cf-93a9-674977000312', 'CTPT', '[\"- Cam kết ko lừa đảo kiểu “Treo đầu dê, bán thịt chó”: đăng tin ảo, đăng hình của phòng 6 triệu mà ghi giá thấp 3 triệu, khách gọi điện thì bảo còn, nhưng đến nơi thì bảo vừa cho thuê xong, rồi giới thiệu phòng khác. Hoặc trả lời với khách hình ảnh tin đăng chỉ mang tính chất minh họa, tính chất quảng cáo\",\"------------------------\",\"- Hình thật, phòng thật, đúng hình, đúng phòng này, ko làm mất thời gian đôi bên\",\"- Tôi là chủ nhà, chỉ gọi điện, ko nhắn tin (NHẮN TIN LÀ TÔI CHẶN)\",\"- Không cho nuôi chó/mèo\",\"-----------------------\",\"- Giá: 6tr3/tháng (nếu hợp đồng 12 tháng) – 6tr5/tháng (nếu hợp đồng 6 tháng)\",\"- Phòng đang trống sẳn, dọn vào ở liền được\",\"-----------------------\",\"- 38m2, ở lầu 2\",\"- Phòng mới, rộng, sạch, đẹp đúng hình\",\"- Có cửa sổ + BAN CÔNG lớn, rất thoáng mát, view đẹp\",\"- Đủ tiện nghi:\",\"+ 2 TỦ QUẦN ÁO\",\"+ 1 MÁY LẠNH xịn (inverter)\",\"+ 1 NỆM\",\"+ 2 QUẠT\",\"+ 1 BÀN LÀM VIỆC, GHẾ\",\"+ 1 KỆ DÉP\",\"+ 1 bàn BẾP + labo rửa + kệ chén\",\"- Toilet riêng trong phòng\",\"- Có MÁY GIẶT chung\",\"- Giờ giấc tự do, chìa khóa riêng\",\"- Có wifi cáp quang\",\"- Có nhà để xe rộng rãi (miễn phí), camera an ninh\",\"- Gần ngay cổng Đại học Văn Lang\",\"Phù hợp vợ chồng, sinh viên có điều kiện\",\"--------------------------\",\"- Điện: 3.500đ/KW\",\"- Nước máy: 100.000đ/người\",\"- Rác: 30.000đ/phòng\",\"- Wifi: 80.000đ/1 người (120.000đ/2 người)\",\"- Máy giặt: 100.000đ/phòng/tháng (nếu sử dụng)\",\"(Xe miễn phí)\",\"--------------------------\",\"ĐC: 73 Đặng Thùy Trâm, P.13, Bình Thạnh (nhà mặt tiền)\",\"LH: 0933.333.033 Danh (chủ nhà, trực tiếp)\"]', 'f962385d-f28d-49c9-beec-b656198592de', '4d317c5e-e32a-4804-b856-8a11ca978bd2', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
('8f5ad910-3b59-4db6-9b66-e11f43eb0bbc', 'Cho thuê phòng CHDV gò vấp đầy đủ nội thất', '3', 'PNSW8', 'Địa chỉ: 416/19 Đường Dương Quảng Hàm, Phường 5, Quận Gò Vấp, Hồ Chí Minh', '2b2ca60f-4df0-42fc-a4d2-aa7d848c8274', 'CTCH', '[\"Còn 1 phòng có thể ban giao chuyển vào đầu tháng 10 đã set úp lại một số thứ.\",\"Gần chợ Gò Vấp, siêu thị Vincom Lote , gần 2 chợ nhỏ,Đại Học Công Nghiệp Thành Phố , gần trường Cao đẳng Bách Việt\",\". Chỉ mất 5 phút đi xe máy ra Đại lộ Phạm Văn Đồng , ngã 5 chuồng chó...v..v\",\"Địa chỉ : 416/19 Dương Quảng Hàm phường 5 quận Gò Vấp . Tp Hồ Chí Minh\",\"-Nhà với gần 30 phòng nằm trong hẻm yên tĩnh, thoáng mát. Nhà có thang máy, chỗ để xe rộng rãi, bảo vệ 24/24 vui vẻ, nhiệt tình.\",\"-Phòng rộng 30m², Phòng sạch sẽ, an ninh, yên tĩnh Phòng có đầy đủ\",\"- Phòng được trang bị đầy đủ : kệ bếp, tủ lạnh, máy lạnh 2hp, máy giặt, giường nệm cao su non êm ái, tủ quần áo, sofa bàn, chậu cây trang tri...vv có thê dọn vào ở ngay\",\"-Chúng tôi cam kết tuyệt đối với bạn rằng! Hình chụp như thế nào thì phòng của bạn như thế đó. Thậm chí có thể đẹp hơn trong thực tế nếu bạn tới xem trực tiếp.\"]', 'cd926278-96e4-40b4-bc4f-a6c41516b31e', '9828da3e-eb1a-48bc-ae0f-dca7f471d284', NULL, '2023-10-04 03:36:54', '2023-10-04 03:36:54'),
('8f6079c4-046a-4f94-bb1e-999ac90a771f', 'Phòng trọ mới 100% chung cư Long Sơn Building mặt tiền Huỳnh Tấn Phát , Quận 7. An ninh- Thoáng mát.', '5', 'ZOTU6', 'Địa chỉ: 1349 Đường Huỳnh Tấn Phát, Phường Phú Thuận, Quận 7, Hồ Chí Minh', '13d4cd52-fe1f-4329-84de-626f36ea02cb', 'CTPT', '[\"Cần cho thuê phòng riêng chung cư Long Sơn Building , Huỳnh Tấn Phát ngay mặt tiền lớn thuận tiện đi lại , không ngập nước.\",\"- Phòng 10m2 có thông gió vách ngăn giá 1tr7.\",\"- Phòng 15m2 có ban công view Phú Mỹ Hưng giá 2tr4\",\"- Phòng 13m2-15m2 có cửa sổ view Phú Mỹ Hưng tuờng nguyên giá 2tr2-2tr4\",\"- Phòng master duy nhất 1 phòng 22m2 có tolet riêng trong phòng ở dc 3 bạn giá 3tr5.\",\"Căn hộ thông gió nhiều thoáng mát và rất mạnh.\",\"- Không chung chủ, Giờ giấc tự do. Có tủ lạnh bảo quản thức ăn - nước uống và máy giặt dùng chung cho 1 căn hộ. Bảo vệ an ninh camera 24/24 ngoài hàng lang thang máy và trong căn hộ, mỗi tầng chỉ có 6 căn hộ, thiết kế căn hộ riêng biệt nên rất yên tĩnh.\",\"Wifi 5G mạnh vi vu. Có 2 tầng hầm gửi xe.\",\"Tiện ích ngay chung cư:\",\"- Có 6 tầng trung tâm thương mại phía trước.\",\"- Có sẵn Phòng Gym Power - Fisnet yoga, Sân chơi Gold 3D đang ghịnh hành. Hãng xe ô tô nổi tiếng Jeep... Đều đang hoạt động.\",\"- Ngay cạnh Phú Mỹ Hưng, Quận 7, Co. Op Mart, Crescent Mall, Cầu Phú Mỹ,...\",\"- Ngay mặt tiền đường Huỳnh Tấn Phát bán kính 100m xung quanh đầy đủ quắn ăn, cafe, gara, tạp hoá, siêu thị đầy đủ.\",\"Liên hệ hoặc nhắn zalo để thêm thông tin và hẹn xem phòng.\",\"Xin cảm ơn..!\"]', '7bff8549-d8ef-49e4-98ed-3eff983e0346', '7ec6a4a4-93a3-4ef6-88f6-5dec341000ea', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
