('daaaa935-c06a-465e-ab92-422f5f757b1d', 'CHO THUÊ PHÒNG TRỌ VỊ TRÍ KẾ BÊN TRƯỜNG TIỂU HỌC QUỚI XUÂN QUẬN 12 (Chính chủ)', '3', 'DVAV4', 'Địa chỉ: 219 Đường Tô Ngọc Vân, Phường Thạnh Xuân, Quận 12, Hồ Chí Minh', '7b13f6dc-6609-483a-90c6-c9c2cc38b84b', 'CTPT', '[\"- Mặt tiền đường Tô Ngọc Vân. Sát bên trường Cấp I Quới Xuân - thuận tiện cho gia đình có con nhỏ đi học\",\"- Gần ĐH Nguyễn Tất Thành, cao đẳng Điện lực, cầu Phú Long, ngã tư ga,...\",\"- Gần khu vực chợ\",\"- Phòng có gác,nhà vệ sinh riêng, phòng có gạch ốp tường\",\"- Trước phòng là công viên\",\"- Giá thuê: 1.700.000 VNĐ/tháng (không bao gồm chi phí điện, nước, internet, vệ sinh)\",\"- Phòng mới được sơn sửa mới\",\"- An ninh: khu vực an ninh\",\"- Khu vực xung quanh có đầy đủ tiện ích như siêu thị, chợ, trường học, bệnh viện, Giờ giấc tự do, không chung chủ,\"]', 'c2b6efae-294b-4d55-bbda-3c08990d3253', 'cd1d6be9-1469-4e87-9322-8bd7fb578fa3', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
('e292823d-28e2-4d5e-bb29-5c1f0526d9e3', 'Mặt bằng mới set up ngay Cầu Vượt Sóng Thần 70m2 có 1PN riêng', '0', 'CPND1', 'Địa chỉ: 143 Quốc lộ 1A, Phường An Bình, Huyện Dĩ An, Bình Dương', '3c8a8269-125c-4df0-a0e7-1ae3260607c0', 'CTMB', '[\"Mặt bằng mới set up ngay Cầu Vượt Sóng Thần 70m2 có 1PN riêng\",\"Cho thuê kiot , mặt bằng mới set up ngay Cầu Vượt Sóng Thần\",\"Phù hợp mọi nghành nghê, trần cao ráo, vị trí đẹp , phù hợp với gia đình hoặc hộ kinh doanh nhỏ, vừa ở vừa kinh doanh…\",\"Có thiết kế 1 phòng ngủ riêng biệt, cửa cuốn, vỉa hè rộng rãi\",\"Giá chỉ 6.5tr, cọc 2 tháng. Có 2 kiot liền kề thuê cả 2 thì 12tr\",\"Địa chỉ: 143 Quốc Lộ 1A, An Bình , Dĩ An, Bình Dương, ngay chân Cầu Vượt Sóng Thần, giáp đường An Bình\",\"Liên hê chị Thúy: 0942.402.708\"]', '340da38f-da5f-40c2-bd6a-d05013867aea', '38580ee8-f18f-425e-97c2-5f634a69fd8f', NULL, '2023-10-04 03:37:26', '2023-10-04 03:37:26'),
