('f05630c1-784c-4350-b937-dac739bc9b48', 'Cho thuê MBKD góc 2mt số 78 Bình Giã P13 Tân Bình', '0', 'UTOP4', 'Địa chỉ: 78 Bình Giã, Phường 13, Quận Tân Bình, Hồ Chí Minh', '0849e39c-8256-4460-8f37-8dd06587a4fd', 'CTMB', '[\"Mặt bằng góc 2 mặt tiền đường số 78 Bình Giã, P.13, Tân Bình.\",\"- Đường đông xe qua lại, vị trí đẹp sáng thoáng\",\"- Kinh doanh mọi ngành nghề đều ok\",\"- DT: 4.5x16m đã sơn sửa mới 100%\",\"- Kết cấu 1 trệt 1 lửng, sàn suốt, có 2 wc riêng. HĐT dài hạn\",\"Giá: 22tr /tháng\",\"️0898176296 - 0932643246 (Chính Chủ, có hoa hồng cho sale)\"]', '97a7983a-e3cd-481e-81b6-36515b0f564d', '20dc81e4-eb16-4c43-a3f3-5b4044a1f7c1', NULL, '2023-10-04 03:37:26', '2023-10-04 03:37:26'),
('f0775f13-20bc-4247-9010-ec9fb48157dd', 'Căn hộ mini full nội thất. Tiện ích xung quanh', '0', 'VAJX5', 'Địa chỉ: 127/17 Đường Âu Cơ, Phường 14, Quận 11, Hồ Chí Minh', 'f0de5979-b3e0-4d1e-af18-06ad49c7f688', 'CTCH', '[\"Phòng full nội thất quận 11. Gần vòng xoay Lê Đại Hành. Hẻm oto quay đầu, xung quanh là chợ dân sinh, coopmart, cửa hàng tiện lợi, bệnh viện,..\",\"Giá thuê 4tr3/người. Thêm người +200k\",\"Nước 100k/người. Điện 3k5. Phí dịch vụ 100k\",\"Phòng có cửa sổ to, thông thoáng. Khoá thẻ từ thông minh.\",\"Trống từ 15/11. Miễn trung gian nhé, inb để xem phòng luôn ạ\"]', 'dbcb9b01-46f3-42f7-adf9-aee4bb51f177', '2856f9c1-2d9e-4403-bc6b-249366ef5d22', NULL, '2023-10-04 03:36:54', '2023-10-04 03:36:54'),
('f4c9ee83-3561-44dc-a150-dc21269810ce', 'CHO THUÊ MẶT BẰNG 95M2 THÀNH PHỐ QUY NHƠN', '0', 'PXCS8', 'Địa chỉ: Phường Nhơn Phú, Thành Phố Quy Nhơn, Bình Định', 'f14a08a5-ab3e-4787-bd49-3a3ac54a95de', 'CTN', '[\"CHO THUÊ MẶT BẰNG 95M2 THÀNH PHỐ QUY NHƠN\",\"Phù hợp cho việc kinh doanh cà phê/trà sữa/quán ăn/quán nhậu.\",\"Giá : 4 triệu/ 1 tháng\",\"Vị trí:\",\"Tổ 6, khu vực 5, phường Nhơn Phú, thành phố Quy Nhơn, tỉnh Bình Định\",\"️Cách trường Cao Đẳng Bình Định 50m, trường Ischool\",\"️Gần bệnh viện y học dân tộc\",\"️Khu trung tâm gần công viên, các quán cà phê, trà sữa và các quán nhậu\",\"️Cách đường Hùng Vương 20m\",\"Đặc điểm:\",\"️Nhà hướng Tây Bắc\",\"️Diện tích: 95m2 (Mặt Tiền10m)\",\"️Có toilet riêng\",\"️Khu vực bếp riêng\",\"️Phòng ngủ riêng, có thể ngủ lại\",\"️Nước máy và nước giếng riêng biệt\"]', 'da14fe38-1325-4921-86dc-06ff75efd8c7', 'b5574647-d4fa-43d6-80e7-c1b86e9490bd', NULL, '2023-10-04 03:37:37', '2023-10-04 03:37:37'),
('f6cfb670-af76-4593-a2b9-496cda0a9775', 'Cho thuê Đât nông nghiệp diện tích 1300 m2', '0', 'TBYP6', 'Địa chỉ: 43 112, Xã Tân Phú Trung, Huyện Củ Chi, Hồ Chí Minh', '90a94072-5156-406c-a8e4-65a95f149f7a', 'CTMB', '[\"- khu vực an ninh tốt\",\"- trên đât có điện nước đầy đủ\",\"- cách chợ, trường học, bệnh viện, UBND đi xe máy tầm 7 phút\"]', '724be453-8f08-4de8-b0e1-826b0c0f9b92', 'e15cf0e7-c903-4a5a-a6ec-b669881f0d0d', NULL, '2023-10-04 03:37:26', '2023-10-04 03:37:26'),
('fa78ab2d-c5bf-4a5b-8cc5-91f9c4b21e9d', '[Bình Thạnh] Chủ cần cho thuê phòng như hình mới đủ tiện nghi đẹp gần chợ Bà Chiểu, giá 5 tr', '4', 'VEFN5', 'Địa chỉ: 5 Đường Nơ Trang Long, Phường 7, Quận Bình Thạnh, Hồ Chí Minh', '25372d32-35cf-4321-aec2-029bee69e037', 'CTPT', '[\"Phòng mới đều thông thoáng, xe hơi đến tận nhà. hình chụp thật 100%\",\"*Đặc điểm: tiện nghi đầy đủ chỉ cần xách quần áo vào ở. Có kệ bếp riêng và được nấu ăn.\",\"Chỗ để xe rộng rãi, xe hơi có thể đậu trước nhà. Chỉ cần xách va li vào ở.\",\"GIờ giấc tự do, ra vào có chìa khóa riêng, khu vực chung vệ sinh sạch sẽ miễn phí.\",\"*Chỉ thu chi phí sử dụng điện, nước, wifi\",\"*Miễn phí: truyền hình cáp, bãi đậu xe có camera quan sát trong và ngoài, vệ sinh, an ninh, rác..\",\"*Vị trí:nằm trong khu vực dân sinh cao cấp, người dân ý thức, không trộm cướp. Ngoài sân và trong nhà đều lắp đặt hệ thống camera giám sát an ninh. Đầu đường và cuối đường là chốt công an khu vực thường xuyên đi tuần tra.\",\"Nhà ngay ngã tư Đinh Tiên Hoàng, Nơ Trang Long, Phan Đăng Lưu, gần chợ Bà Chiểu, bên hông bệnh viện Ung Bướu, khu vực sầm uất về đêm, nhiều nhà hàng, quán ca phê, siêu thị tiện lợi, coop mart, các dịch vụ làm đẹp......khu dân cư an ninh, cao cấp chỉ cần đi bộ là có thể mua mọi thứ cần thiết.\",\"Giao thông: thông với các con đường: hoàng Hoa Thám, Phan Đăng Lưu, Đinh Tiên Hoàng, Vạn Kiếp, Vũ Huy Tấn.....\",\"Hiện tại nhà mới bắt đầu cho thuê, còn nhiều phòng cho các bạn chọn lưa. Có ưu đãi cho các bạn thuê lâu dài. ƯU tiên người đi làm cần không gian yên tĩnh, riêng tư thoải mái để nghỉ ngơi.\",\"Liên hệ xem nhà từ 9h đến 19h\",\"Chúc mọi người ngày làm việc tốt lành!\"]', 'a4f50012-4723-4e8a-a751-45655dc5d875', '6d428d5c-5fe2-4ec9-adbe-62b5c4ab85ef', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51'),
('fd0adabe-b7bc-48a5-9a82-53d58e1cf53f', 'Chính chủ cho thuê phòng trọ view mặt đường phố đi bộ', '3', 'KHZM7', 'Địa chỉ: 73 Đường Trần Nhân Tông, Phường Nguyễn Du, Quận Hai Bà Trưng, Hà Nội', '76ae345e-d3a8-4be4-bcad-d85b84624b3a', 'CTPT', '[\"- View mặt tiền phố đi bộ\",\"- Phòng trọ riêng biệt cho từng sàn\",\"- Điện, nước riêng biệt phí thoả thuận\",\"- Nấu ăn, giặt phơi tầng thượng\",\"- Giá cụ thể từng phòng theo tầng: tầng 2: 4.1 tr, t3: 3.9 tr, t4: 3.7 tr, t5 3.5 tr\",\"- Giá dịch vụ: Điện riêng/chung: 3800đ/số. Wifi 100k/người/tháng. Nước 25k/m3. 200k/người/1tháng: dọn dẹp.\"]', '999c2bbe-e280-4bc8-aceb-a1393e6d65cf', '0729eecb-9161-4af2-b483-483634c26593', NULL, '2023-10-04 03:37:51', '2023-10-04 03:37:51');
